import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import { Login } from './component/login';
import Home from './component/home';


function App(){
  return(
    <>
  <button onClick={()=>{
      <BrowserRouter>
  <Routes>
    <Route path='/' element={<Login/>}/>
    <Route path='home' element={<Home/>}/>
  </Routes>
  </BrowserRouter>  
  }}>kasem</button>


  </>
  )

}

export default App;
